import "./App.css";

function App() {
  const value = "hello wleocme to react";
  const like = 50;
  const person = { name: "rejish", age: 22 };
  return (
    <div className="App">
      <header className="App-header">
        <h1>{value}</h1>
        <p>Like is {like} times</p>
        <p>{person}</p>
      </header>
    </div>
  );
}

export default App;
